"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F4151782\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Spara (JP);",
"     </li>",
"     <li>",
"      Sparlox (IN);",
"     </li>",
"     <li>",
"      Sparx (ZA);",
"     </li>",
"     <li>",
"      Torospar (IN);",
"     </li>",
"     <li>",
"      Zagam (CH, DE, FR, LU, PL)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F4151783\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Antibiotic, Quinolone",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F4151784\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of adults with community-acquired pneumonia caused by",
"     <i>",
"      C. pneumoniae",
"     </i>",
"     ,",
"     <i>",
"      H. influenzae",
"     </i>",
"     ,",
"     <i>",
"      H. parainfluenzae",
"     </i>",
"     ,",
"     <i>",
"      M. catarrhalis",
"     </i>",
"     ,",
"     <i>",
"      M. pneumoniae",
"     </i>",
"     or",
"     <i>",
"      S. pneumoniae",
"     </i>",
"     ; treatment of acute bacterial exacerbations of chronic bronchitis caused by",
"     <i>",
"      C. pneumoniae",
"     </i>",
"     ,",
"     <i>",
"      E. cloacae",
"     </i>",
"     ,",
"     <i>",
"      H. influenzae",
"     </i>",
"     ,",
"     <i>",
"      H. parainfluenzae",
"     </i>",
"     ,",
"     <i>",
"      K. pneumoniae",
"     </i>",
"     ,",
"     <i>",
"      M. catarrhalis",
"     </i>",
"     ,",
"     <i>",
"      S. aureus",
"     </i>",
"     or",
"     <i>",
"      S. pneumoniae",
"     </i>",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F4151786\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Loading dose: 400 mg on day 1",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Maintenance: 200 mg/day for 10 days total therapy",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     <b>",
"      Dosing adjustment in renal impairment:",
"     </b>",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &lt;50 mL/minute: Administer 400 mg on day 1, then 200 mg every 48 hours for a total of 9 days of therapy (total 6 tablets)",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821086\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F4151787\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Tablet: 200 mg",
"    </p>",
"   </div>",
"  </div>",
