" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Gooseneck deformity of atrioventricular (AV) canal defect",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 343px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Echocardiographic image from subcostal location demonstrating the gooseneck deformity that results from elongation and narrowing of the left ventricular outflow tract (arrow) in AV canal defects. The superior bridging leaflet is seen \"scooping out\" the subaortic region during diastole.",
"    <div class=\"footnotes\">",
"     Ao: aorta; LV: left ventricle; RA: right atrium; S: superior; I: inferior; R: right; L: left.",
"    </div>",
