"   <p class=\"headingAnchor\" id=\"H4\">",
"    <span class=\"h1\">",
"     SUMMARY AND RECOMMENDATIONS",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Numerous physiological changes occur during pregnancy to accommodate the maternal and fetal needs. This table shows common, and not so common, laboratory test values across pregnancy (",
"      <a class=\"graphic graphic_table graphicRef81137 \" href=\"UTD.htm?37/33/38424\">",
"       table 1",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H2\">",
"       'Normal reference ranges in pregnancy'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
