" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 570px\">",
"   <div class=\"ttl\">",
"    Atypical adenomatous hyperplasia of the prostate",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 550px; height: 277px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Right panel: hematoxylin- and eosin-stained section of a prostate biopsy showing atypical adenomatous hyperplasia, with its characterstic small crowded glands mimicking prostatic adenocarcinoma. However, minimal cytologic atypia and patchy basal cells (arrowheads) are present. Left panel: Immunohistocehmical staining with 34bE12 demonstrates basal cells (arrowheads) in an area of atypical adenomatous hyperplasia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ximing Yang, MD.",
"    </div>",
"   </div>",
