var title_f14_7_14457="Treatment of acne";
var content_f14_7_14457=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F76250&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F76250&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 626px\">",
"   <div class=\"ttl\">",
"    Acne treatment algorithm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 606px; height: 508px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BPO: benzoyl peroxide; topical antimicrobials: benzoyl peroxide, topical antibiotics.",
"     <br/>",
"     * With small nodules (&gt;0.5-1 cm).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Prescribing benzoyl peroxide concomitantly with topical or oral antibiotics will minimize the emergence of antibiotic resistance.",
"     <br/>",
"     &Delta; Second course in case of relapse.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Consider physical removal of comedones.",
"     <br/>",
"     &sect; There was not consensus on this alternative recommendation, however, in some countries Azelaic acid prescribing is appropriate practice.",
"     <br/>",
"     &yen; For females who are not pregnant.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Gollnick H, Cunliffe W, Berson D, et al. Management of acne: A report from a Global Alliance to Improve Outcomes in Acne. J Am Acad Dermatol 2003; 49:S1. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
