" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Serotonin-norepinephrine reuptake inhibitor antidepressants: Pharmacokinetics",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"8\" width=\"12%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Bioavailability",
"        <br/>",
"        (percent)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Time to peak plasma concentration",
"        <br/>",
"        (hours)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Primary metabolism*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Active metabolite(s)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect(s) on drug metabolism",
"        <br/>",
"        (significant)*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Elimination half-life",
"        <br/>",
"        (hours)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clearance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Desvenlafaxine",
"       </td>",
"       <td>",
"        <p>",
"         80",
"        </p>",
"        Unaffected by food",
"       </td>",
"       <td>",
"        7.5",
"       </td>",
"       <td>",
"        UGT glucuronidation",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        <p>",
"         9-11",
"        </p>",
"        Prolonged in renal or hepatic impairment",
"       </td>",
"       <td>",
"        Hepatic and renal; 45 percent excreted unchanged; dose adjustment needed in setting of renal or hepatic insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"8\">",
"        Venlafaxine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immediate release",
"       </td>",
"       <td>",
"        <p>",
"         13",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        Unaffected by food",
"       </td>",
"       <td>",
"        1-2",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         CYP2D6",
"        </p>",
"        CYP3A4",
"       </td>",
"       <td rowspan=\"2\">",
"        Yes (desvenlafaxine)",
"       </td>",
"       <td rowspan=\"2\">",
"        None",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         5 (parent)",
"        </p>",
"        <p>",
"         11 (active metabolite)",
"        </p>",
"        Prolonged in renal or hepatic impairment",
"       </td>",
"       <td rowspan=\"2\">",
"        Renal and hepatic; 87 percent excreted unchanged; dose adjustment needed in setting of renal or hepatic insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Extended release",
"       </td>",
"       <td>",
"        <p>",
"         45",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        Unaffected by food",
"       </td>",
"       <td>",
"        5.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Duloxetine",
"       </td>",
"       <td>",
"        <p>",
"         50",
"        </p>",
"        Wide interindividual variation (30-80); minimally affected by food",
"       </td>",
"       <td>",
"        <p>",
"         6 (unfed)",
"        </p>",
"        10 (fed)",
"       </td>",
"       <td>",
"        <p>",
"         CYP1A2",
"        </p>",
"        CYP2D6",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Inhibits CYP2D6",
"       </td>",
"       <td>",
"        <p>",
"         10 to 12",
"        </p>",
"        Prolonged in hepatic impairment",
"       </td>",
"       <td>",
"        Hepatic and renal; avoid in hepatic insufficiency (any degree), liver disease, or substantial alcohol use; dose adjustment needed in setting of renal insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Milnacipran",
"       </td>",
"       <td>",
"        <p>",
"         85-90",
"        </p>",
"        Unaffected by food",
"       </td>",
"       <td>",
"        2-4",
"       </td>",
"       <td>",
"        Glucuronidation",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        <p>",
"         8 to 10",
"        </p>",
"        Prolonged in severe hepatic impairment and renal impairment of any degree",
"       </td>",
"       <td>",
"        Renal and hepatic; 55 percent excreted unchanged; dose adjustment needed in setting of renal insufficiency",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
