"     <br/>",
"     <span>",
"      &bull;",
"     </span>",
"     Oral bioavailability is increased by 2 to 3 fold in hepatic insufficiency due to decreased presystemic (first-pass) hepatic extraction.",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
